import React, { Component } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'reactstrap';

class Home extends Component {
    render() {
        return (
            <Container>
                <Row>
                <Col xs="6">
                    <Row>
                        <Col>Color Picker</Col>
                    </Row>
                    <Row>
                        <Col>List Color</Col>
                    </Row>
                </Col>
                <Col xs="6">
                    Size
                </Col>
            </Row>
            <Row>
                <Col>.col</Col>
            </Row>
            </Container>
        )
    }
}

export default Home;
